(4, 1, 102, 2, 'Tuesday', NULL, '2021-06-17 18:23:31', '2021-06-22', 3, 2, 'E learning Orientation', 'Learning Portal, Conferencing Platform 1', 'The students were introduced to two learning platforms. The Everest Gauge Learning Portal and the video conferencing platform. In this case Google Meet was used. At least 17 learners were seen active at varying points on the system. The initial challenge was how to log into the system. Eventually they settled in. Network issues had some on and off but on average majority remained active to the end.', '1. Smart Phones, PC and laptops\r\n', '1. Google Meet\r\n2. Everest Gauge Learning System (www.everestgauge.com/learn)\r\n3. KINTU Report Portal', 'N/A', '0', 'Screenshot_20210622-181003.png', 'The lecture was well led and the students were working hand in hand with the lecturer.\r\nJust that a few of them didn\'t know how to use the features and the icons in both applications.\r\nGenerally the network work wasn\'t well both at the beginning and the end of the lecture where some of the students were on and off but still stayed in touch with the on going activity.\r\nIn a nutshell, everything was well coordinated despite the network and data.', NULL, 25000, 0, 75000, 0, 50000, 0, 2, '', 'true', NULL, NULL, NULL, NULL, 10),
