(1062, 1, 103, 1, 'Friday', NULL, '2021-07-02 21:25:15', '2021-07-02', 3, 2, 'Types of communication skills, ', 'The different communication channels', 'Participatory class Lecture', 'Hand out', 'Google search ', '0', '0', NULL, 'Today\'s lecture with Madam has been really great, students turned up in big numbers which showed some bit of seriousness. They have been cooperative despite the network failures buh thank God it came to an end and students are somehow familiar with the online kind of studying.\r\n43 students attended the communication skills lecture today.', NULL, 25000, 0, 75000, 0, 50000, 0, 2, '', 'true', NULL, NULL, NULL, NULL, 12),
(1063, 1, 103, 1, 'Friday', NULL, '2021-07-02 21:25:15', '2021-07-16', 3, 2.5, 'Business reports', 'Types and components of a business report ', 'Participatory ', 'Group presentations from students', 'Google search ', '0', '0', NULL, 'The lecture was very fine with Madam Aisha,we were able to look at the process of communication and importances of communication.\r\nMadam gave us presentation questions and course works.\r\nThe students were cooperative unlike the unfriendly network during the lecture.\r\nHowever, everything went on smoothly with great participation.\r\n33 students attended the communication skills lecture altogether.', NULL, 25000, 0, 75000, 0, 62500, 0, 2, '', 'true', NULL, NULL, NULL, NULL, 12),
(1064, 1, 103, 1, 'Friday', NULL, '2021-07-02 21:25:15', '2021-07-16', 3, NULL, 'Topic', 'Subtopic', NULL, NULL, NULL, '0', '0', NULL, 'The lecture was so great with Madam. We had presentations by group A who discussed about components of a business report,types of reports and characteristics of a good report.\r\nStudents\'coordination was at maximum despite the on and off occurrences due to network challenges.\r\nHowever, the number of students joining increases day by day which implies that most of them have adopted this kind of studying.\r\n44 students attended the communication skills lecture altogether.', NULL, 25000, 0, 75000, 0, NULL, NULL, 2, '', NULL, NULL, NULL, NULL, NULL, 12),
(1065, 1, 103, 1, 'Friday', NULL, '2021-07-02 21:25:15', '2021-07-23', 3, 2, 'Report writting', 'Key considerations in report writing ', 'Participatory ', 'Student\'s group presentations ', 'Google search ', '0', '0', NULL, 'The lecture was well conducted by Madam,students were cooperative and we had presentations from group B who discussed about report writing.\r\nEverything went on smoothly and surely this type of learning is reliable despite network challenges which keeps members on and off.\r\n39 students attended communication skills altogether.', NULL, 25000, 0, 75000, 0, 50000, 0, 2, '', 'true', NULL, NULL, NULL, NULL, 12),
(1066, 1, 103, 1, 'Friday', NULL, '2021-07-02 21:25:15', '2021-07-30', 3, 2.5, 'Communication barriers', 'Barriers to effective communication and solutions to such barriers ', 'Presentation and participatory', 'Notes', 'Google ', '27', '0', NULL, 'The lecture was well conducted by Madam in cooperation with the students.\r\nWe had presentations from group C who dicused about traditional communication, barriers and solutions for effective communication.\r\nStudents\' participation was good in addition to the consistency in attendance despite the data problems faced by a few which denies them access to online lectures.\r\nIn a nutshell,all is well and we\'re all hoping for the best.\r\n37 students attended communication skills.', NULL, 25000, 0, 75000, 0, 62500, 0, 2, '', 'true', NULL, NULL, NULL, NULL, 12),
